import React from 'react';
import { Card } from 'react-bootstrap';

export default function Receipt(props) {

    const { order } = props;

    let body = <Card.Body>
        <Card.Text></Card.Text>
    </Card.Body>;

    return(
        <Card>
            <Card.Body>
                <Card.Title>{order.CustomerName}<br/>Receipt ID: {order.OrderId}</Card.Title>
                <Card.Text></Card.Text>
            </Card.Body>
        </Card>
    );
}
